from collections import defaultdict

def numericals(s):
    d, lst = defaultdict(int), []
    for c in s:
        d[c] += 1
        lst.append(d[c])
    return ''.join(map(str, lst))

def numericals(line):

    counts = dict.fromkeys(line, 0)
    output = []
    for char in line:
        counts[char] += 1
        output.append(counts[char])

    return ''.join(str(number) for number in output)

def numericals(s):
    history = {}
    result = []
    for char in s:
        if char not in history:
            history[char] = 1
        else:
            history[char] += 1
        result.append(history[char])
    return "".join(map(str, result))

