from collections import Counter

def numericals(s):
    def f(s):
        cnts = Counter()
        for c in s:
            cnts[c] += 1
            yield cnts[c]
    return ''.join(map(str, f(s)))

def numericals(s):
    d = {x:0 for x in s}
    result = []
    for symbol in s:
        d[symbol] += 1
        result.append(str(d[symbol]))
    return ''.join(result)

from collections import defaultdict

def numericals(stg):
    count, result = defaultdict(int), []
    for c in stg:
        count[c] += 1
        result.append(f"{count[c]}")
    return "".join(result)

